import numpy as np

def rolling_min(real, n):
    rolling_min = np.zeros(0)
    for x in range(len(real)+1):
        if x >= n:
            #print("%s // " %(x) ,min(real[x-n:x]), " // " ,real[x-n:x])
            rolling_min = np.append(rolling_min, min(real[x-n:x]))
    return rolling_min

def rolling_max(real, n):
    rolling_max = np.zeros(0)
    for x in range(len(real)+1):
        if x >= n:
            rolling_max = np.append(rolling_max, max(real[x-n:x]))
    return rolling_max

def fish_transform(my_last, my_high, my_low, n, weight):

    Median = (my_high + my_low) / 2
    Median = Median[n-1:]
    MLow = rolling_min(my_low, n)
    MHigh = rolling_max(my_high, n)

    I = np.zeros(0)
    fisher_result = np.zeros(0)

    x = 0
    for x in range(len(Median)):
        if x == 0:
            calc = (weight * 2 * (( Median[x] - MLow[x]) / (MHigh[x] - MLow[x]) - 0.5))
            calc = 0.999 if calc > 0.99  else -0.999 if calc < -0.99 else calc
            I = np.append(I, calc)
            fisher = 0.5*np.log((1 + calc)/(1 - calc))
            fisher_result = np.append(fisher_result , fisher)
        else:
            calc = (weight * 2 * (( Median[x] - MLow[x]) / (MHigh[x] - MLow[x]) - 0.5)) + (1 - weight) * I[x - 1]
            calc = 0.999 if calc > 0.99  else -0.999 if calc < -0.99 else calc
            I = np.append(I, calc)
            fisher = weight*np.log((1 + calc)/(1 - calc))+(1 - weight)*fisher_result[x - 1]
            fisher_result = np.append(fisher_result , fisher)
        x += 1

    return fisher_result


